import { Route, Routes, Link } from "react-router-dom";

const PrivateRoute = ({ element: Element, ...rest }) => (
  <Routes>
    <Route
      {...rest}
      render={(props) =>
        localStorage.getItem("user.token") ? (
          <Element {...props} />
        ) : (
          <Link to={{ pathname: "/login" }} />
        )
      }
    />
  </Routes>
);
export default PrivateRoute;
